import React, { useState } from "react";

const AddTask = (props) => {
  const todoLists = {
    id: null,
    title: "",
    details: "",
  };
  const [todos, setTodos] = useState(todoLists);

  return (
    <div>
      <form onSubmit={handleSubmit}>
        <label>Title</label>
        <input
          type="text"
          name="title"
          value={todos.title}
          onChange={onChangeInput}
        />
        <label>Details</label>
        <input
          type="text"
          name="details"
          value={todos.details}
          onChange={onChangeInput}
        />
        <button type="submit">Add New Task</button>
      </form>
    </div>
  );
};

export default AddTask;
